import React, { Component } from 'react';

class ChapterTextLinks extends Component {
  render() {
    return (
      <div className="chapter-text-links">
        <a href="#0">A walk along the cliff edge</a>
        <a href="#0">US GDP: Q2 Tracking at 3.4%</a>
      </div>
    );
  }
}

export default ChapterTextLinks;
